var startButton = document.getElementById('startButton');
startButton.addEventListener("click", startInteraction);
startButton.addEventListener("touchstart", startInteraction);

function startInteraction() {
    event.preventDefault();
    var imageDisplay = document.getElementById("imageDisplay");
    var audio = document.getElementById("audio");
    this.style.display = 'none';

    imageDisplay.src = frontImage;
    imageDisplay.style.display = "block";
    audio.play();

    function startImageChange() {
    if (imageDisplay.src === ted) {
        imageDisplay.src = inverseTed;
    } else {
        imageDisplay.src = ted;
    }

    setTimeout(startImageChange, getRandomNumberBetween(50, 200));
}

setTimeout(startImageChange, 4000);

}
function getRandomNumberBetween(min, max) {
    return Math.floor(Math.random() * (max - min + 1)) + min;
}
